import React from 'react';

function App() {
    function App() {
        return (
          <div className="App">
            <NavBar />
            <Route exact path='/' component={Home} />
            <Route exact path='/product' component={Product} />
            <Route exact path='/contact' component={Contact} />
          </div>
        );
      }
  }

export default ImgComp;
